class Producto extends Component {
    render() {
        return (
            <ul>
                {console.log(this.props)}
                <li>Nombre: {this.props.product.name}</li>
                <li>Precio: {this.props.prices}</li>
            </ul>
        );
    }
}
export default Producto;
